package axcrudobject

import (
	"github.com/stretchr/testify/assert"
	"net/url"
	"path"
	"testing"
	"time"
)

func TestBase64String_Bytes(t *testing.T) {
	s := Base64String(base64data)
	bytes, err := s.Bytes()
	if assert.Nil(t, err) {
		assert.Greater(t, len(bytes), 100)
	} else {
		t.Fatal(err)
	}
	assert.Equal(t, s.Mime(), "image/png")
}

func TestBase64String_Bytes2(t *testing.T) {
	s := Base64String(base64jpg)
	bytes, err := s.Bytes()
	if assert.Nil(t, err) {
		assert.Greater(t, len(bytes), 100)
	} else {
		t.Fatal(err)
	}
	assert.Equal(t, s.Mime(), "image/jpeg")
}

func TestBase64File_CreatePath(t *testing.T) {
	mediaPath := "./media/"
	fileName, ext := "test", ".png"
	tm := time.Date(2011, 01, 02, 12, 33, 00, 0, time.UTC)
	savePath := path.Join(mediaPath, tm.Format("2006/01/02"), fileName+ext)
	assert.Equal(t, savePath, "media/2011/01/02/test.png")

	dn := time.Now().Format("2006/01/02/")
	res, _ := getMediaPath(mediaPath, fileName, ext, "opts", true, 0)
	assert.Equal(t, res, "media/opts/"+dn+"test.png")

	res, _ = getMediaPath(mediaPath, fileName, ext, "", true, 0)
	assert.Equal(t, res, "media/"+dn+"test.png")

	res, _ = getMediaPath(mediaPath, fileName, ext, "opts", false, 0)
	assert.Equal(t, res, "media/opts/test.png")

	res, _ = getMediaPath(mediaPath, fileName, ext, "", false, 0)
	assert.Equal(t, res, "media/test.png")
}
func TestBase64File_CreateMedia(t *testing.T) {
	mediaPath := "/media/"
	tm := time.Date(2011, 01, 02, 12, 33, 00, 0, time.UTC)
	fileName, ext := "test", ".png"

	baseUrl, _ := url.Parse(mediaPath)
	baseUrl, _ = baseUrl.Parse(tm.Format("2006/01/02/"))
	baseUrl, _ = baseUrl.Parse(fileName + ext)

	assert.Equal(t, baseUrl.String(), "/media/2011/01/02/test.png")

	dn := time.Now().Format("2006/01/02/")
	res, _ := getMediaUrl(mediaPath, fileName+ext, "opts", true)
	assert.Equal(t, res, "/media/opts/"+dn+"test.png")

	res, _ = getMediaUrl(mediaPath, fileName+ext, "", true)
	assert.Equal(t, res, "/media/"+dn+"test.png")

	res, _ = getMediaUrl(mediaPath, fileName+ext, "opts", false)
	assert.Equal(t, res, "/media/opts/test.png")

	res, _ = getMediaUrl(mediaPath, fileName+ext, "", false)
	assert.Equal(t, res, "/media/test.png")

}

var base64jpg = `data:image/jpeg;base64,`

var base64data = `data:image/png;base64,`
